import React from 'react';
import{useState,useEffect} from "react"
import secondpage from './secondpage';

function SecondFrontPage() {

const [data,setData]=useState([])
function click(){
fetch("https://www.themealdb.com/api/json/v1/1/search.php?s")
.then((response)=>response.json())
.then((datas)=>{
    console.log(datas.meals);
  const food=[{
      Instructions:datas.meals[0].strInstructions,
      image:datas.meals[0].strMealThumb,
      links:datas.meals[0].strYoutube,
      mealname:datas.meals[0].strMeal,
  }, { Instructions:datas.meals[1].strInstructions,
        image:datas.meals[1].strMealThumb,
        links:datas.meals[1].strYoutube,
        mealname:datas.meals[1].strMeal,
}]
      
    
    setData(food)
  
 })
.catch((e)=>{
    console.log(e);
})}
useEffect(()=>{
click()

},[])

 return <div>
   <secondpage  image={data[0].image}  Instructions={data[0].Instructions} videolinks={data[0].links}  mealname={data[0].name}/>
   <secondpage  image={data[1].image}  Instructions={data[1].Instructions} videolinks={data[1].links}  mealname={data[1].name}/>
   
  </div>;
}

export default SecondFrontPage;
